import styled from "styled-components";

export default function IndexPage() {
  return (
    <>
      <Button onClick={() => console.log("hello there")}>Click me</Button>
    </>
  );
}

const Button = styled.button`
  background: white;
  border: 3px solid black;
  border-radius: 20px;
  font-size: 40px;
  padding: 20px;
`;
